    AppComponent,
    LoginComponent,
    EnquiryComponent,
    AboutUsComponent,
    LocationComponent,
    ContactUsComponent,
    CustomerRelationshipManagerComponent,
    OperationalExecutiveComponent,
    CreditManagerComponent,
    AccountHeadComponent,
    HomeComponent,
    HomeHeaderComponent,
    DashHeaderComponent,
    DashboardComponent,
    EMICalculatorComponent,
    UserMenuComponent,
    ApplyloanComponent,
    ReqcibilComponent,
    ViewEnquiryComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ReactiveFormsModule,
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
